<title>RAJAGAMES OFFICIAL SURESHOT</title>
<link href="./index_files/css2" rel="stylesheet">
<style>
  *, *::before, *::after { margin: 0; padding: 0; box-sizing: border-box; }

  html, body {
    font-family: 'Inter', sans-serif;
    background: #0b2a28;
    min-height: 100vh;
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    overflow-x: hidden;
  }

  .card {
    background: linear-gradient(160deg, #0f3533 0%, #0a2826 50%, #071e1c 100%);
    border-radius: 26px;
    padding: 28px 20px 34px;
    width: 100%;
    max-width: 100vw;
    display: flex;
    flex-direction: column;
    align-items: center;
    box-shadow: 0 20px 60px rgba(0,0,0,0.6);
    border: 1px solid rgba(255,255,255,0.05);
    margin: 16px;
  }

  /* TOP BADGE */
  .top-badge {
    background: #00e5c8;
    color: #062220;
    font-size: clamp(12px, 3.5vw, 15px);
    font-weight: 800;
    padding: 10px 24px;
    border-radius: 50px;
    margin-bottom: 22px;
    text-align: center;
    white-space: nowrap;
  }

  /* IMAGE */
  .profile-img-wrap {
    width: min(75vw, 260px);
    height: min(75vw, 260px);
    border-radius: 20px;
    overflow: hidden;
    border: 3px solid rgba(255,215,0,0.3);
    margin-bottom: 20px;
    background: #1a3a38;
    flex-shrink: 0;
    box-shadow: 0 8px 30px rgba(0,0,0,0.4);
  }
  .profile-img-wrap img {
    width: 100%;
    height: 100%;
    object-fit: cover;
    display: block;
  }

  /* TITLE */
  .title {
    font-size: clamp(26px, 7vw, 34px);
    font-weight: 900;
    color: #ffffff;
    text-align: center;
    line-height: 1.15;
    letter-spacing: 0.5px;
    margin-bottom: 8px;
    text-transform: uppercase;
  }

  /* SUBTITLE */
  .subtitle {
    font-size: clamp(13px, 3.5vw, 16px);
    color: rgba(255,255,255,0.5);
    text-align: center;
    font-weight: 400;
    margin-bottom: 20px;
  }

  /* CTA BUTTON */
  .cta-btn {
    display: block;
    width: 100%;
    background: #00e5c8;
    color: #062220;
    font-size: clamp(16px, 4.5vw, 20px);
    font-weight: 900;
    text-align: center;
    text-decoration: none;
    padding: 18px 20px;
    border-radius: 50px;
    letter-spacing: 1px;
    margin-bottom: 12px;
    box-shadow: 0 6px 30px rgba(0,229,200,0.35);
    -webkit-tap-highlight-color: transparent;
    transition: transform 0.1s, box-shadow 0.1s;
  }
  .cta-btn:active {
    transform: scale(0.97);
    box-shadow: 0 3px 15px rgba(0,229,200,0.3);
  }

  /* HURRY */
  .hurry {
    font-size: clamp(13px, 3.5vw, 15px);
    font-weight: 700;
    color: #00e5c8;
    margin-bottom: 22px;
  }

  /* DIVIDER */
  .divider {
    width: 100%;
    height: 1px;
    background: rgba(255,255,255,0.08);
    margin-bottom: 20px;
  }

  /* FEATURES */
  .features {
    width: 100%;
    display: flex;
    flex-direction: column;
    gap: 14px;
    margin-bottom: 22px;
  }
  .feature-item {
    display: flex;
    align-items: center;
    gap: 12px;
    font-size: clamp(14px, 3.8vw, 16px);
    color: rgba(255,255,255,0.88);
    font-weight: 500;
  }
  .star { font-size: clamp(17px, 4vw, 20px); flex-shrink: 0; }

  /* STATS */
  .stats { text-align: center; }
  .stats .exp {
    font-size: clamp(13px, 3.5vw, 15px);
    color: rgba(255,255,255,0.55);
    font-weight: 400;
    margin-bottom: 4px;
  }
  .stats .community {
    font-size: clamp(15px, 4vw, 18px);
    font-weight: 800;
    color: #00e5c8;
  }
</style>
</head>
